import React from 'react'
import style from "./Todo.module.css"
const AddTodo = () => {
    return (
        <div>
            <form action="" className={style.formToDo}>
                <input type="text" placeholder="Write..."/>
                <button>Add ToDo</button>
            </form>
        </div>
    )
}
export default AddTodo;
